import React, { useState } from 'react';

const FAQSection = () => {
  const [openFAQ, setOpenFAQ] = useState(null);

  const faqs = [
    {
      id: 1,
      question: "What services does Skygate Group offer?",
      answer: "Skygate Group provides comprehensive logistics and travel solutions through two specialized divisions. Skygate Logistics handles freight forwarding from the United States and China, warehousing, supply chain management, and last-mile delivery. Skygate Travel offers corporate travel management, leisure travel planning, group coordination, and 24/7 travel support."
    },
    {
      id: 2,
      question: "How long has Skygate Group been in business?",
      answer: "Skygate Group was founded in 2018 with experience dating back to 2009. We have over 7 years of professional service experience, serving 750+ clients worldwide with a 96% satisfaction rate and 99.9% data protection guarantee."
    },
    {
      id: 3,
      question: "Do you handle both logistics and travel services?",
      answer: "Yes, Skygate Group operates two specialized divisions under one company. Skygate Logistics focuses on freight forwarding, warehousing, and supply chain solutions. Skygate Travel handles corporate travel management, leisure planning, and group coordination. Both divisions work together to provide comprehensive business solutions."
    },
    {
      id: 4,
      question: "What makes Skygate Group different?",
      answer: "Skygate Group stands out through our advanced tracking technology, white-glove service, dedicated account managers, and multilingual team. We offer 24/7 emergency response support, secure data handling, and industry expertise across healthcare, education, and e-commerce sectors. Our commitment to excellence and innovation drives everything we do."
    },
    {
      id: 5,
      question: "How do I get started with your services?",
      answer: "Getting started is simple. Contact us through our website's contact form, specifying whether you need logistics or travel services. Our team will schedule a consultation to understand your specific needs and provide a customized solution. We offer free initial consultations and detailed project proposals."
    },
    {
      id: 6,
      question: "Do you provide international support?",
      answer: "Yes, Skygate Group provides comprehensive international support. We serve clients in 50+ countries with 24/7 customer support availability. Our multilingual team ensures seamless communication across global markets, and we have established partnerships worldwide to deliver reliable service wherever you need us."
    }
  ];

  const toggleFAQ = (id) => {
    setOpenFAQ(openFAQ === id ? null : id);
  };

  return (
    <section className="py-20 bg-gray-50">
      <div className="max-w-4xl mx-auto px-4 sm:px-6 lg:px-8">
        {/* Section Header */}
        <div className="text-center mb-16">
          <h2 className="text-4xl md:text-5xl font-bold text-gray-900 mb-6">
            Frequently Asked Questions
          </h2>
          <p className="text-xl text-gray-600 max-w-3xl mx-auto leading-relaxed">
            Find answers to common questions about our services and how we can help your business succeed.
          </p>
        </div>

        {/* FAQ Items */}
        <div className="space-y-4">
          {faqs.map((faq) => (
            <div
              key={faq.id}
              className="bg-white rounded-lg border border-gray-200 shadow-sm hover:shadow-md transition-shadow duration-200"
            >
              <button
                className="w-full px-6 py-5 text-left focus:outline-none focus:ring-2 focus:ring-primary-500 focus:ring-offset-2 rounded-lg"
                onClick={() => toggleFAQ(faq.id)}
                aria-expanded={openFAQ === faq.id}
                aria-controls={`faq-answer-${faq.id}`}
              >
                <div className="flex justify-between items-center">
                  <h3 className="text-lg font-semibold text-gray-900 pr-4">
                    {faq.question}
                  </h3>
                  <div className="flex-shrink-0">
                    {openFAQ === faq.id ? (
                      <svg
                        className="w-5 h-5 text-primary-600"
                        fill="none"
                        stroke="currentColor"
                        viewBox="0 0 24 24"
                      >
                        <path
                          strokeLinecap="round"
                          strokeLinejoin="round"
                          strokeWidth={2}
                          d="M20 12H4"
                        />
                      </svg>
                    ) : (
                      <svg
                        className="w-5 h-5 text-gray-400"
                        fill="none"
                        stroke="currentColor"
                        viewBox="0 0 24 24"
                      >
                        <path
                          strokeLinecap="round"
                          strokeLinejoin="round"
                          strokeWidth={2}
                          d="M12 6v6m0 0v6m0-6h6m-6 0H6"
                        />
                      </svg>
                    )}
                  </div>
                </div>
              </button>

              {/* Answer */}
              <div
                id={`faq-answer-${faq.id}`}
                className={`overflow-hidden transition-all duration-200 ease-in-out ${
                  openFAQ === faq.id ? 'max-h-96 opacity-100' : 'max-h-0 opacity-0'
                }`}
              >
                <div className="px-6 pb-5">
                  <div className="border-t border-gray-100 pt-4">
                    <p className="text-gray-600 leading-relaxed">
                      {faq.answer}
                    </p>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>

        {/* See More FAQs Link */}
        <div className="text-center mt-12">
          <button
            onClick={() => {
              // Scroll to contact section
              const contactSection = document.querySelector('#get-in-touch') || 
                                   document.querySelector('[href="/contact"]');
              if (contactSection) {
                contactSection.scrollIntoView({ behavior: 'smooth' });
              } else {
                window.location.href = '/contact';
              }
            }}
            className="inline-flex items-center text-primary-600 hover:text-primary-700 font-medium transition-colors duration-200 focus:outline-none focus:ring-2 focus:ring-primary-500 focus:ring-offset-2 rounded-lg px-4 py-2"
          >
            <span>Have more questions?</span>
            <svg
              className="w-4 h-4 ml-2"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth={2}
                d="M17 8l4 4m0 0l-4 4m4-4H3"
              />
            </svg>
          </button>
        </div>
      </div>
    </section>
  );
};

export default FAQSection;
